import './App_copy.css';
import React from 'react';
import img2 from "./deleta.png";
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Link, Route, Switch } from "react-router-dom";
import { Button, DatePicker,Select, version, message, Avatar,Input, Image, Card, Tabs ,List, Space,Radio } from "antd";
import "antd/dist/antd.css";
import zhCN from 'antd/lib/locale/zh_CN';
import moment from 'moment';
import 'moment/locale/zh-cn';
import { UserOutlined } from '@ant-design/icons';
import { MessageOutlined, LikeOutlined, StarOutlined } from '@ant-design/icons';
const { Meta } = Card;


const { TabPane } = Tabs;
const data = [
  {
    title: 'Ant Design Title 1',
  },
  {
    title: 'Ant Design Title 2',
  },
  {
    title: 'Ant Design Title 3',
  },
  {
    title: 'Ant Design Title 4',
  },
];

const { Option } = Select;

function onChange(value) {
  console.log(`selected ${value}`);
}
function onBlur() {
  console.log('blur');
}
function onFocus() {
  console.log('focus');
}
function onSearch(val) {
  console.log('search:', val);
}
function callback(key) {
  console.log(key);
}

moment.locale('zh-cn');




class Routrcs extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      isActivename: "top_active",
      value: 1,
    }
  }
  onChange = e => {
    console.log('radio checked', e.target.value);
    this.setState({
      value: e.target.value,
    });
  };
  Glactive = () => {

  }
  render() {
    console.log(this.props.datacont)
    return (

      <ul className="top_qh">
        <li className="">
          <Link to={{pathname:"/",state:this.props.datacont}}  ><Button type="primary">卡片视图</Button></Link>
        </li>
        <li className="">
          <Link to='/login'><Button type="primary">列表视图</Button></Link>
        </li>

        {/* <li className="">
          <Link to='/info'>田园</Link>
        </li> */}
      </ul>

    )
  }
}


class Info extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      itemList: [],
      itemList1: [],
      titledata: ["所有", "现代", "田园", "欧式", "美式", "中式", "日式", "北欧", "地中海", "东南亚", "简欧", "工业风", "简美", "工装"],
      selectdata: "所有"

    }
  }

  render() {
    return (
      <div>
    <Card
      style={{ marginTop: 16 }}
      type="inner"
      title="关联信息"
      extra={<a href="#">More</a>}
    >
      <div className="sjlist">
        <span className="sjlname">
          项目
        </span>
        <Select
          showSearch
          style={{ width: "79%" }}
          placeholder="单击进行搜索选择"
          optionFilterProp="children"
          onChange={onChange}
          onFocus={onFocus}
          onBlur={onBlur}
          onSearch={onSearch}
          filterOption={(input, option) =>
            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
          }
